pub unsafe fn vld3q_s8(a: *const i8) -> int8x16x3_t {
    unsafe extern "unadjusted" {
        #[cfg_attr(
            any(target_arch = "aarch64", target_arch = "arm64ec"),
            link_name = "llvm.aarch64.neon.ld3.v16i8.p0"
        )]
        fn _vld3q_s8(ptr: *const int8x16_t) -> int8x16x3_t;
    }
    _vld3q_s8(a as _)
}
